(96, 'Villa La Pausa', '03-2022-Villa-La-Pausa-Podaca-Croatia-96', '<p>Villa La Pausa is located in Zaostrog, a charming coastal town and port in the southern part of sunny Dalmatia. If you are looking for a destination for the perfect family vacation with your fury best friend, this stunning l villa is the choice for you! In keeping with its name, the contemporary and elegant Villa La Pausa promises a break from the hectic everyday life in a beautiful location with unsurpassed views of the clear Adriatic Sea.</p>\r\n\r\n<p>Villa La Pausa Interior</p>\r\n\r\n<p>In its 163 m2 of modern living space, the fully air-conditioned Villa La Pausa provides<strong>&nbsp;accommodation for a total of 8 guests on two floors</strong>. The upper floor of the villa features three beautifully airy bedrooms equipped with a comfortable double bed, offering accommodation for 6 guests. Each bedroom has its own en-suite bathroom with a lovely walk-in shower. Most importantly, all bedrooms provide a gorgeous sea view. Waking up to it every morning will be a particularly pleasant experience! Remaining two guests have at their disposal a comfortable sofa bed located in the living room on the ground floor of the villa. Alongside the pleasant living room with sofa and Smart TV, the spacious, open-plan ground floor consists of a<strong>&nbsp;fully equipped, minimalist kitchen</strong>&nbsp;as well as a delightful dining area. Storage room, laundry and one separate bathroom complete the offer of the attractive ground floor. The interior of Villa La Pausa is i<strong>ncredibly airy, abounds in natural light and radiates serenity</strong>&nbsp;and home atmosphere.</p>', 'Villa La Pausa is located in Zaostrog, a charming coastal town and port in the southern part of sunny Dalmatia. If you are looking for a destination for the perfect family vacation with your fury best friend, this stunning l villa is the choice for you! In keeping with its name, the contemporary and elegant Villa La Pausa promises a break from the hectic everyday life in a beautiful location with unsurpassed views of the clear Adriatic Sea.\r\n\r\nVilla La Pausa Interior\r\nIn its 163 m2 of modern living space, the fully air-conditioned Villa La Pausa provides accommodation for a total of 8 guests on two floors. The upper floor of the villa features three beautifully airy bedrooms equipped with a comfortable double bed, offering accommodation for 6 guests. Each bedroom has its own en-suite bathroom with a lovely walk-in shower. Most importantly, all bedrooms provide a gorgeous sea view. Waking up to it every morning will be a particularly pleasant experience! Remaining two guests have at their disposal a comfortable sofa bed located in the living room on the ground floor of the villa. Alongside the pleasant living room with sofa and Smart TV, the spacious, open-plan ground floor consists of a fully equipped, minimalist kitchen as well as a delightful dining area. Storage room, laundry and one separate bathroom complete the offer of the attractive ground floor. The interior of Villa La Pausa is incredibly airy, abounds in natural light and radiates serenity and home atmosphere.', 10, 38, '1642673013', 44.27605, 15.4903, 'Lučica 2, 21335, Podaca', '12', 'Splitsko dalmatinska', '21 335', 'Croatia', 'Podaca', '989,984,985,986,987,988,982,983,973,974,975,976,977,966,967,968,969,970,971,960,961,962,963,964,965,956,957,958,959,950,951,953,954,955,945,947,949,941,938,934,935,937,929,930,927,933,921,922', '985', 8, 3, 4, 163.00, 5, -1, 'per_night', 450.00000, NULL, 'sun', 'a:0:{}', '4,112,113,114,115,116,117,120,163,164', '{\"Outdoors\":null,\"Cooling &amp; Heating\":[\"AC\"],\"Living room\":[\"SAT TV\"],\"Living room # 2\":null,\"Living room # 3\":null,\"Kitchen\":[\"Fully equipped kitchen\",\"Coffee machine\",\"Oven\",\"Dishwasher\",\"Ice maker\",\"Blender\",\"Wine cooler\",\"Toaster\",\"Microwave\",\"Fridge with freezer\",\"Dishwasher\",\"BBQ gas charcoal\",\"Indoor dining area for: 8\",\"Child\'s high chair: 1\",\"Outdoor dining area for: 8\"],\"Bedroom 1\":null,\"Bedroom 2\":null,\"Bedroom 3\":null,\"Bedroom 4\":null,\"Bedroom 5\":null,\"Bedroom 6\":null,\"Bedroom 7\":null,\"Bathroom\":null,\"Wellnes\":null,\"Garden\":null,\"Laundry\":[\"Washing machine\",\"Iron and board\"]}', '{\"Sea\":\"130 m\",\"Restaurant\":\"2.5 km\",\"Town center\":\"2 km\",\"Cafe bar\":\"700 m\",\"Doctor\":\"1.5 km\",\"Marina\":\"3 km\",\"Market\":\"700 m\",\"Airport\":\"50 km\",\"ATM\":\"2 km\"}', '155', 'off', NULL, NULL, '16:00', '09:00', NULL, 'off', 'off', 'publish', 'instant', 'a:1:{i:0;a:2:{s:4:\"name\";s:5:\"Other\";s:8:\"ical_url\";s:76:\"https://api.adriatic.hr/ical/calendar/40166/fc36869587d3513069abc83c215872af\";}}', 0.000000, 0.000000, 0.000000, 'off', '#', 'Check Out', 'home', 'off', 0.000000, 1, NULL, '', '', 'Advance percent: 40% of total price\r\nSecurity Deposit: €500 (paid on arrival)\r\nSojourn Tax: Included in price\r\nPayment Methods: Credit Card, Bank Transfer\r\nMaximum guests: 8\r\nPets: Pets are allowed on request. Charges may apply', 'off', '', '', 'off', 'off', 35.000000),
(97, 'Villa Frami', '03-2022-Villa-Frami-Starigrad-Croatia-97', '<p>In rustic surroundings of Stari Grad kod Senja is placed idyllic luxury beachfront villa &ldquo;Frami&rdquo;. It&rsquo;s concept is based on idea of spreading the sense of timeless natural beauty and sophistication emphasizing traditional stone and glass. Design itself embraces an authentic blend of modernism and Mediterranean style.</p>\r\n\r\n<p>Beautifully modern and stylish four-bedroom villa was built in 2020.<br />\r\nThe ground floor has a fully equipped modern kitchen with a large dining room and a separate living room. All the rooms on the ground floor are facing the main terrace, pool and a breathtaking sea views.On the&nbsp; upper floor there are four rooms&nbsp; and each room with a king-size bed, flat-screen TV, a terrace and a private bathroom.</p>', 'In rustic surroundings of Stari Grad kod Senja is placed idyllic luxury beachfront villa “Frami”. It’s concept is based on idea of spreading the sense of timeless natural beauty and sophistication emphasizing traditional stone and glass. Design itself embraces an authentic blend of modernism and Mediterranean style.\r\n\r\nBeautifully modern and stylish four-bedroom villa was built in 2020.\r\nThe ground floor has a fully equipped modern kitchen with a large dining room and a separate living room. All the rooms on the ground floor are facing the main terrace, pool and a breathtaking sea views.On the  upper floor there are four rooms  and each room with a king-size bed, flat-screen TV, a terrace and a private bathroom.', 20, 35, '1642755046', 44.796032, 14.879549, 'Starigrad kod Senja', '15', 'Ličko senjska', '53 284', 'Croatia', 'Starigrad', '1000,998,1001,1002,999,992,1042,1041,1040,1039,1014,1036,1017,1016,1013,1007,1006,1005,1004,1003,1023,1021,1024,1030,1029,1028,1035,1034,1033,256,1018,993,997,995,996,1022,1032,1019,1020,1031', '1002', 8, 4, 4, 220.00, 5, -1, 'per_night', 600.00000, NULL, 'sun', 'a:0:{}', '4,112,113,116,120', '{\"Outdoors\":null,\"Cooling &amp; Heating\":null,\"Living room\":null,\"Living room # 2\":null,\"Living room # 3\":null,\"Kitchen\":[\"Fully equipped kitchen\",\"Coffee machine\",\"Oven\",\"Dishwasher\",\"Ice maker\",\"Blender\",\"Wine cooler\",\"Toaster\",\"Microwave\",\"Fridge with freezer\",\"Dishwasher\",\"BBQ gas charcoal\",\"Indoor dining area for: 10\"],\"Bedroom 1\":null,\"Bedroom 2\":null,\"Bedroom 3\":null,\"Bedroom 4\":null,\"Bedroom 5\":null,\"Bedroom 6\":null,\"Bedroom 7\":null,\"Bathroom\":[\"Bathroom\",\"Shower\",\"Towels\",\"Bathtub\",\"Private bathroom\",\"Shower cabin\",\"shower enclosure\",\"Hairdryer\",\"Bidet\",\"Sink\",\"Toilet\",\"5 bathrooms\"],\"Wellnes\":[\"Pool\",\"Sun loungers\",\"Sun umbrellas\",\"Garden furniture\",\"Panoramic view\",\"Complete privacy\"],\"Garden\":[\"Sun loungers\",\"Sun umbrellas\",\"Garden furniture\",\"Panoramic view\",\"Lounge set\",\"Dining set\",\"Grill\",\"Outside kitchen\"],\"Laundry\":[\"Washing machine\",\"Iron and board\"]}', '{\"Sea\":\"3 m\",\"Restaurant\":\"15 km\",\"Town center\":\"30 km\",\"Cafe bar\":\"30 km\",\"Doctor\":\"30 km\",\"Marina\":\"30 km\",\"Market\":\"30 km\",\"Airport\":\"90 km\",\"ATM\":\"30 km\"}', '154,155', 'off', NULL, NULL, '16:00', '09:00', NULL, 'off', 'on', 'publish', 'instant', 'a:0:{}', 0.000000, 0.000000, 0.000000, 'off', '#', 'Check Out', 'home', 'off', 0.000000, 1, NULL, '', '', 'The price includes: VAT (if applicable) and tourist tax.\r\nProperty security deposit : 800,00 €', 'on', '', '', 'off', 'on', 35.000000),
(98, 'Villa Blue Moon', '03-2022-villa-blue-moon-Podaca-Croatia-98', '<p>Villa Blue Moon is an enchanting modern villa with amazing sea views. The beach is 70 m underneath the villa, but you can also choose to spend your time on the terrace with a private pool and everything necessary for a relaxing vacation.</p>\r\n\r\n<p>Since the villa is located on a slope, it is divided into 3 levels. It can accommodate up to 9 persons in 4 beautiful bedrooms. The lowest floor of the villa has a separate from terrace or from upper floor and is designed to act as one with the spacious terrace out front .. On the lowest floor, there is a cosy area with heated pool,Jacuzzi and sauna .One part of the pool is under the villa ,its designed if its raining or its cold that in the all time guests have heated area pool. On upper flor is beautiful living room and kitchen with have terrace of 40 m2 with amazing view on the sea on the other part is one master bedroom with bath in the middle room . Directly from the living room you have entrance of villa and large terrace with BBQ .On the second and last floor there is also 3 double bedroom .Each bedroom have en suite bathroom. Each room in the villa have heating floor ,carpet ,TV and WiFi. A staircase is connecting the ground floor with the first floor of the villa. Two rooms has a beautiful sea view and a covered terrace, and the other room have view on garden . The garden of the villa Blue Moon speaks for itself. Being only 70 meters away from the sea, every part of the garden has unbelievable sea views. The beautiful private pool surrounded with sun loungers, a grill where you can prepare all kinds of meals and a decked terrace which can take up to 9 persons, together with this incredible view offers everything you might need to relax!</p>', 'Villa Blue Moon is an enchanting modern villa with amazing sea views. The beach is 70 m underneath the villa, but you can also choose to spend your time on the terrace with a private pool and everything necessary for a relaxing vacation.\r\n\r\nSince the villa is located on a slope, it is divided into 3 levels. It can accommodate up to 9 persons in 4 beautiful bedrooms. The lowest floor of the villa has a separate from terrace or from upper floor and is designed to act as one with the spacious terrace out front .. On the lowest floor, there is a cosy area with heated pool,Jacuzzi and sauna .One part of the pool is under the villa ,its designed if its raining or its cold that in the all time guests have heated area pool. On upper flor is beautiful living room and kitchen with have terrace of 40 m2 with amazing view on the sea on the other part is one master bedroom with bath in the middle room . Directly from the living room you have entrance of villa and large terrace with BBQ .On the second and last floor there is also 3 double bedroom .Each bedroom have en suite bathroom. Each room in the villa have heating floor ,carpet ,TV and WiFi. A staircase is connecting the ground floor with the first floor of the villa. Two rooms has a beautiful sea view and a covered terrace, and the other room have view on garden . The garden of the villa Riva speaks for itself. Being only 70 meters away from the sea, every part of the garden has unbelievable sea views. The beautiful private pool surrounded with sun loungers, a grill where you can prepare all kinds of meals and a decked terrace which can take up to 9 persons, together with this incredible view offers everything you might need to relax!', 20, 46, '1642760266', 43.122849, 17.310289, 'Podaca , Zvirine', '16', 'splitsko dalmatinska', '21 335', 'Croatia', 'Podaca', '913,914,915,908,909,902,910,903,904,905,906,898,899,900,901,893,894,895,896,897,889,890,891,892,881,882,883,884,885,886,887,888,876,877,878,879,880,870,871,872,873,874,864,865,866,867,868,869', '889', 8, 4, 5, 300.00, 5, -1, 'per_night', 300.00000, NULL, 'sun', 'a:0:{}', '4,112,113,114,115,116,120', '{\"Outdoors\":null,\"Cooling &amp; Heating\":null,\"Living