(99, 'Villa Amare', '03-2022-villa-amare-Šibenik-Croatia-99', '<p>This perfectly designed &rdquo; Villa Amare&rdquo; by the owner, into which they have poured all their love and knowledge, but what this villa will delight you is untouched nature, privacy and the scent of lavender and vines. This amazing property&nbsp; is a modern, recently built villa located in a small place called Dubrava just on north side of &Scaron;ibenik , only seven minutes away by car from town. The nearest beach is just 3 km distance from the villa, as well as the many local amenities.</p>\r\n\r\n<p>The villa is situated on a 1200 m2 large, completely enclosed plot and has 200 m2 of interior. In a perfect nature surrounded by a century-old vineyard this luxury villa will outstrip your expectations.The ground floor of the villa consists of a completely equipped kitchen which continues to the large living room with bathroom and beautiful and 1 design bedroom &ndash; 3 bedrooms are located on the 1st floor of the villa, master bedroom who is situated also on 1 st floor has a own bathroom, walking closet and large terrace with view on breathtaking nature, two bedrooms are sharing a large bathroom, while one bedroom on north side also have walking closet.The villa is suitable for 8 persons, but can accommodate also 1 additional persons on sofa beds in the living room. Special feature of the villa is also a large, 45 m2 swimming pool on situated in the nature that only can give you this.</p>', 'This perfectly designed ” Villa Amare” by the owner, into which they have poured all their love and knowledge, but what this villa will delight you is untouched nature, privacy and the scent of lavender and vines. This amazing property is a modern, recently built villa located in a small place called Dubrava just on north side of Sibenik , only seven minutes away by car from town. The nearest beach is just 3 km distance from the villa, as well as the many local amenities.\r\n\r\nThe villa is situated on a 