(101, 'Villa Santa Lucia', '03-2022-Villa-Santa-Lucia-Supetar-Croatia-101', '<p>Located in a small village just 3 km away from Supetar and surrounded by glorious Brač nature specific for that area, Villa Santa Lucia is the perfect choice for a relaxing family vacation.</p>\r\n\r\n<p>During the renovation , a lot of attention and care was given to preserving the villa&acute;s traditional charm, both from the inside as well as from the outside. On the first floor you will find an open plan living and dining area which create a warm and welcoming atmosphere. On this floor there is also one cosy bedroom with double bed with sea view , an also&nbsp; bathroom .The other 2 bedrooms, both air conditioned and equipped with a TV, are located on separated area near the house..This two bedrooms and two bathrooms are bulited in bunja ,.Bunja is an ancient name for masonry armor that served shepherds during bad weather. From this ancient stone and great history, the owners have adapted into a separate part of the house where there are two bedrooms overlooking the pool and the sea. The window sills come from an old stone church that is 1700 years old. This amazing Villa Santa Lucia will give you everything a luxury and the smell of history and intrigue of how the old shepherds lived.<br />\r\nThe villa is located on 8000 m2 of olive groves where the owners have designed each part of the land to provide a separate oasis.</p>\r\n\r\n<p>With a total of 3 bedrooms and 3 bathrooms villa can accommodate up to 7 persons. On the ground floor villa provide a gym and area for relax.The outside area is no less dashing: surrounded by a carefully tended garden, here you will find your own private swimming pool. You can also prepare delicious meals on the stone barbecue and dine al fresco, while enjoying the peacefulness of the nature of island Brač overlooking the sea . The youngest guests will be thrilled with the fact that there is also a playground at their disposal.</p>', 'Located in a small village just 3 km away from Supetar and surrounded by glorious Brač nature specific for that area, Villa Santa Lucia is the perfect choice for a relaxing family vacation.\r\n\r\nDuring the renovation , a lot of attention and care was given to preserving the villa´s traditional charm, both from the inside as well as from the outside. On the first floor you will find an open plan living and dining area which create a warm and welcoming atmosphere. On this floor there is also one cosy bedroom with double bed with sea view , an also  bathroom .The other 2 bedrooms, both air conditioned and equipped with a TV, are located on separated area near the house..This two bedrooms and two bathrooms are bulited in bunja ,.Bunja is an ancient name for masonry armor that served shepherds during bad weather. From this ancient stone and great history, the owners have adapted into a separate part of the house where there are two bedrooms overlooking the pool and the sea. The window sills come from an old stone church that is 1700 years old. This amazing Villa Santa Lucia will give you everything a luxury and the smell of history and intrigue of how the old shepherds lived.\r\nThe villa is located on 8000 m2 of olive groves where the owners have designed each part of the land to provide a separate oasis.\r\n\r\nWith a total of 3 bedrooms and 3 bathrooms villa can accommodate up to 7 persons. On the ground floor villa provide a gym and area for relax.The outside area is no less dashing: surrounded by a carefully tended garden, here you will find your own private swimming pool. You can also prepare delicious meals on the stone barbecue and dine al fresco, while enjoying the peacefulness of the nature of island Brač overlooking the sea . The youngest guests will be thrilled with the fact that there is also a playground at their disposal.', 20, 28, '1642790924', 43.37593653621627, 16.596045932733148, 'Supetar, Splitska', '15.121469789430162', 'Splitsko dalmatinska', '21 400', 'Croatia',