(102, 'Villa Salacija', '02-2022-villa-salacija-Rogoznica-Croatia-102', '<p>If you are looking for perfect getaway luxury  Villa Salacija has it all, great sea views, large outdoor area for entertaining, intimacy, luxurious interior, large outdoor swimming pool, just to name the few.</p>\r\n\r\n<p>This newly build Villa suits every taste. With its tasteful design of interior and exterior space it perfectly suits the surroundings of Dalmatian coast and attracts great verity of people from all over the world. It is located between Rogoznica and Primosten and only 30km from the Split airport. It features large outdoor pool,terrace,pergola,barbecue area,satelite television and air conditioning in every room. Its location is perfect for exploring Dalmatian coast and get away from it all at the end of the day.</p>', 'If you are looking for perfect getaway Villa Salacija has it all, great sea views, large outdoor area for entertaining, intimacy, luxurious interior, large outdoor swimming pool, just to name the few.\r\n\r\nThis newly build Villa suits every taste. With its tasteful design of interior and exterior space it perfectly suits the surroundings of Dalmatian coast and attracts great verity of people from all over the world. It is located between Rogoznica and Primosten and only 30km from the Split airport. It features large outdoor pool,terrace,pergola,barbecue area,satelite television and air conditioning in every room. Its location is perfect for exploring Dalmatian coast and get away from it all at the end of the day', 20, 18, '1642795443', 43.54742, 15.94433, 'Rogoznica, Zečevo', '15', 'Šibensko kninska', '22 203', 'Croatia', 'Rogoznica', '861,856,857,858,859,860,851,852,855,853,854,840,841,842,843,849,848,847,835,836,837,838,839,829,830,831,832,833,834,823,824,825,826,827,828,819,820,821,822,814,815,816,817,818,810,811,806,808', '861', 14, 6, 3, 240.00, 5, -1, 'per_night', 500.00000, NULL, 'sun', 'a:0:{}', '4,112,113,116,117,120', '{\"Outdoors\":null,\"Cooling