(104, 'Villa Marvella', '03-2022-Villa-Marvella-Rogoznica-Croatia-104', 'Modern style and luxurious furnishings are distinctive features of Villa Marvella. This Dalmatian beauty takes your breath away with its sophisticated interior and spacious exterior inviting you to fully enjoy every single moment of your stay.\r\n\r\nIn the spacious and open-plan ground floor with gallery are the light-filled living rooms with seaview, a cloakroom, a separate toilet, a room for washing machine, dryer and an additional shower. This villa also features a Disability Access bedroom and bathroom with seaview.\r\n\r\nOn the 1st floor there are 4 fabulous bedrooms with Seaview - one master bedroom with 2 queen size beds and it\'s own terrace and 3 spacious bedrooms with their own bathroom and toilet, shower with cuddle walls and access to the balcony. The villa has its own 50m² saltwater infinity swimming pool with waterfall, integrated massage jets and pool heating.', 'Modern style and luxurious furnishings are distinctive features of Villa Marvella. This Dalmatian beauty takes your breath away with its sophisticated interior and spacious exterior inviting you to fully enjoy every single moment of your stay.\r\n\r\nIn the spacious and open-plan ground floor with gallery are the light-filled living rooms with seaview, a cloakroom, a separate toilet, a room for washing machine, dryer and an additional shower. This villa also features a Disability Access bedroom and bathroom with seaview.\r\n\r\nOn the 1st floor there are 4 fabulous bedrooms with Seaview - one master bedroom with 2 queen size beds and it\'s own terrace and 3 spacious bedrooms with their own bathroom and toilet, shower with cuddle walls and access to the balcony. The villa has its own 50m² saltwater infinity swimming pool with waterfall, integrated massage jets and pool heating.', 20, 18, '1643192877', 43.54161, 15.95057, 'Rogoznica', '15.737345394521475', 'Šibensko kninska', '22 203', 'Croatia', 'Rogoznica', '1138,1137,