(106, 'Villa Valiosa', '03-2022-Villa-Valiosa-Rogoznica-Croatia-106', 'Beachfront Villa Valiosa welcomes you to an unforgettable stay surrounded by elegance and luxury. This extraordinary villa provides complete comfort and privacy for an enjoyable stay.\r\n\r\nIn the spacious and open-plan ground floor with gallery are the light-filled living rooms with Seaview, a cloakroom, a separate toilet, a room for washing machine, dryer and an additional shower. This villa also features a Disability Access bedroom and bathroom with Seaview.\r\n\r\nOn the 1st floor there are 4 fabulous bedrooms with Seaview - one master bedroom with 2 queen size beds and it\'s own terrace and 3 spacious bedrooms with their own bathroom and toilet, shower with cuddle walls and access to the balcony. The villa has its own 55 m² saltwater infinity swimming pool with waterfall, integrated massage jets and pool heating.', 'Beachfront Villa Valiosa welcomes you to an unforgettable stay surrounded by elegance and luxury. This extraordinary villa provides complete comfort and privacy for an enjoyable stay.\r\n\r\nIn the spacious and open-plan ground floor with gallery are the light-filled living rooms with Seaview, a cloakroom, a separate toilet, a room for washing machine, dryer and an additional shower. This villa also features a Disability Access bedroom and bathroom with Seaview.\r\n\r\nOn the 1st floor there are 4 fabulous bedrooms with Seaview - one master bedroom with 2 queen size beds and it\'s own terrace and 3 spacious bedrooms with their own bathroom and toilet, shower with cuddle walls and access to the balcony. The villa has its own 55 m² saltwater infinity swimming pool with waterfall, integrated massage jets and pool heating.', 20, 18, '1643192877', 43.54161, 15.95057, 'Rogoznica', '15', 'Šibensko kninska', '22 203', 'Croatia', 'Rogoznica', '1325,1326,1320,1321,1322,1323,1324,1314,1315,1317,1318,1319,1308,1309,1310,1311,1312,1313,1303,1304,1305,1306,1295,1296,1297,1298,1299,1300,1301,1