(107, 'Villa Draga', '02-2022-Villa-Draga-Solin-Croatia-107', 'Surrounded by historical monuments and only 1 km in distance from the sea, Villa Draga is the right choice for anyone who wants to experience the historical heritage perfectly combined with the modern way of life.\r\n\r\n\r\nIn its 230m2 villa Draga can accommodate 10 people in 3 beautifully decorated bedrooms with 3 bathrooms and 3 separate toilets. The rooms are equipped with double beds, decorated in a combination of modern and rustic. On the ground floor of the villa you can find one bedroom and bathroom, toilet, hallway and staircase leading to the upper floor, living room and a fully equipped kitchen and dining room with 10 seats. In the modern living room, you can find a beautiful sofa, massage armchairs, a fireplace, Smart TV and Home Cinema harmoniously arranged for family gathering or relaxing with friends. The staircase leads to the first floor where you can find two beautifully furnished bedrooms with 2 bathrooms, and a terrace with a picturesque view of Gospin Island. The villa also has a large main room with a double bed and a bathroom on the top floor. In the fully enclosed courtyard of the villa you can find a pretty 10x5 swimming pool equipped with massage jets and anti-current swimming. At disposal for our guests by the pool there are 6 sun loungers. 6 Parking spaces are available in the villa; additional facilities include an outdoor and indoor barbecue, swimming pool equipment, training equipment, and a trampoline for our smallest guests.\r\n\r\n\r\nThe ancient Croatian town of Solin is located on the Jadro River and is extremely rich in historical and cultural heritage, making it a desirable tourist destination. It is adorned by the oldest Marian shrine founded by the Croatian Queen Jelena, the Šuplja Church, which is the crowning site of King Zvonimir and the remains of Ancient Salona, once the capital of the Roman province, believed to be the birthplace of Emperor Diocletian. The rich history and Turkish conquest left its mark on this city. You can also visit the largest Marine Aquariums on Vanjica. The rich culinary offer of this small town and its beautiful surroundings will enchant all guests seeking a romantic getaway in a historically rich environmennt.', 'Below this beautiful pool Villa passes one of the most famous rivers in Croatia, the Jadro River, which guests can look at through a glass floor. The villa contains 3 spacious bedrooms with a huge master suite with a double bed on the top floor of the property. The prestigious location of the villa is located in the heart of the ancient site where the province of the Roman Empire Salon was located (the first mention dates from the 7th century BC). Later in history in the 10th century, the site of the villa was the home of the Croatian royal family. In the same place, Queen Helena built the churches of St. Stephen and St. Mary in Solin.', 20, 45, '1643195794', 43.532684, 16.486897, 'Solin', '18', 'Splitsko dalmatinska', '21 210', 'Croatia', 'Solin', '1382,1383,1384,1385,1379,1380,1381,1375,1376,1377,1378,1371,1372,1373,1374,1367,1368,1369,1370,1361,1362,1363,1364,1365,1366,1357,1358,1359,1360,1352,1353,1354,1355,1356,1348,1349,1350,1351,1', '1377', 7, 3, 3, 230.00, 5, -1, 'per_night', 240.00000, NULL, 'sun', 'a:0:{}', '4,112,113,115,116,120', '{\"Outdoors\":null,\"Cooling &amp; Heating\":null,\"Living room\":null,\"Living room # 2\":null,\"Living room # 3\":null,\"Kitchen\":[\"Fully equipped kitchen\",\"Coffee machine\",\"Oven\",\"Dishwasher\",\"Ice maker\",\"Blender\",\"Wine cooler\",\"Toaster\",\"Microwave\",\"Fridge with freezer\",\"Dishwasher\",\"BBQ gas charcoal\",\"Indoor dining area for: 8\",\"Outdoor dining area for: 8\"],\"Bedroom 1\":null,\"Bedroom 2\":null,\"Bedroom 3\":null,\"Bedroom 4\":null,\"Bedroom 5\":null,\"Bedroom 6\":null,\"Bedroom 7\":null,\"Bathroom\":null,\"Wellnes\":null,\"Garden\":null,\"Laundry\":null}', '{\"Sea\":\"\",\"Restaurant\":\"\",\"Town center\":\"\",\