(109, 'Villa Casta', '02-2022-Villa-Casta-Podstrana-Croatia-109', '<p>Infinity large pool of 70 square meters is the first thing that will delight you.<br />\r\nLocated on 2000 square meters of land, this three bedroom villa has everything you need for your perfect vacation.<br />\r\nThe ground floor of this villa has a living room, kitchen with dining area, bathroom and sauna with jacuzzi.<br />\r\nOn the second floor there are 3 bedrooms with bathrooms.<br />\r\nThe outdoor area also has an outdoor kitchen fully equipped to prepare a warm summer dinner. Sunbeds and corner outdoor sets give that feeling of summer by the pool<br />\r\nThis property is not only amazing because of its luxurious style or large heated pool, but it is also amazing because the location is perfect. Just a few minutes walk from the beach or a few minutes drive to Split. This Villa Casta is ideal for family, friends, a family with a pet or a young group.<br />\r\nIn any case, your stay at Villa Casta will be perfect, we promise you that.</p>', 'Infinity large pool of 70 square meters is the first thing that will delight you.\r\nLocated on 2000 square meters of land, this three bedroom villa has everything you need for your perfect vacation.\r\nThe ground floor of this villa has a living room, kitchen with dining area, bathroom and sauna with jacuzzi.\r\nOn the second floor there are 3 bedrooms with bathrooms.\r\nThe outdoor area also has an outdoor kitchen fully equipped to prepare a warm summer dinner. Sunbeds and corner outdoor sets give that feeling of summer by the pool\r\nThis property is not only amazing because of its luxurious style or large heated pool, but it is also amazing because the location is perfect. Just a few minutes walk from the beach or a few minutes drive to Split. This Villa Casta is ideal for family, friends, a family with a pet or a young group.\r\nIn any case, your stay at Villa Casta will be perfect, we promise you that.', 20, 18, '1643197086', 43.512854252375405,