(111, 'Villa Pokora', '03-2022-villa-pokora-Omiš-Croatia-111', '<p>This villa is one of the most villa located near Omi&scaron;. The name of the villa was given by the owner the name means Pokora (penance ) that is what was taken to make this beautiful house from the scratch.<br />\r\nVilla Pokora is located in the hill of Omi&scaron; which will provide you one of the most beautiful sites in Croatia overlooking the town Omi&scaron; and island Brač. This large property will give you tranquility and peace and time for relax beacuse outside area is situated on 3000 acres of land, pool which overlooks the sea with beautiful scenery .<br />\r\nInside the villa on the ground floor he&#39;s located large kitchen with a dining room and living room and one small bathroom &nbsp;and two bedrooms with un-suit bathroom .On &nbsp;the 1st floor is located two bedrooms with unsuit bathroom, but on the third level of the house you will find a small surprise &nbsp;its a gaming room which have exit on the terrace which have one of the most stunning views in the world.<br />\r\nWe can &nbsp;proudly tell you that Villa Pokora is our gem in all the villas that we have.<br />\r\nFew words can describe this property a truly luxury Croatian villa.</p>', 'This villa is one of the most villa located near Omiš. The name of the villa was given by the owner the name means Pokora (penance ) that is what was taken to make this beautiful house from the scratch.\r\nVilla Pokora is located in the hill of Omiš which will provide you one of the most beautiful sites in Croatia overlooking the town Omiš and island Brač. This large property will give you tranquility and peace and time for relax beacuse outside area is situated on 3000 acres of land, pool which overlooks the sea with beautiful scenery .\r\nInside the villa on the ground floor he\'s located large kitchen with a dining room and living room and one small bathroom  and two bedrooms with un-suit bathroom .On  the 1st floor is located two bedroo