(114, 'Villa Diana', '02-2022-villa-diana-Marina-Croatia-114', '<pre>\r\nLuxury Villa Diana is located near the beautiful town of Trogir. This villa consists of 4 large bedrooms. Each room has its own bathroom. In the master bedroom there is a king size bed with a separate room with another bed. The other 3 bedrooms also have a large double bed, and in one of the bedrooms can be separated beds. The villa is built to the highest Croatian standards. On the ground floor of this villa is a living room, fully equipped kitchen with dining room . \r\nThis Villa is ideal for family or friend and spending time outside.\r\nIf you decide you want to spend the most time you can in the outdoor area then you can cook in the outdoor kitchen which has a BBQ and stone house with a fireplace and minibar. \r\nVilla Diana offers complete enjoyment with heated pool, hydromassage pool and sauna. \r\nChildren have their own space, while you have your own. We know a children\'s playground and trampoline are a must, and for you, there are gym equipment and bicycles available.\r\n. What must be noted is that Villa Diana has a daily cleaning service which is included in the price.</pre>\r\n\r\n<pre>\r\nThis new beautiful luxury Villa Diana will provide the guest  pleasure of vacationing in Croatia. The location of this beauty is ideal for visiting Split, Trogir or the National Park.</pre>', 'Luxury Villa Diana is located near the beautiful town of Trogir. This villa consists of 4 large bedrooms. Each room has its own bathroom. In the master bedroom there is a king size bed with a separate room with another bed. The other 3 bedrooms also have a large double bed, and in one of the bedrooms can be separated beds. The villa is built to the highest Croatian standards. On the ground floor of this villa is a living room, fully equipped kitchen with dining room . \r\nThis Villa is ideal for family or friend and spending time outside.\r\nIf you decide you want to spend the most time you can in the outdoor area then you can cook in the outdoor kitchen which has a BBQ and stone house with a fireplace and minibar. \r\nVilla Diana offers complete enjoyment with heated pool, hydromassage pool and sauna. \r\nChildren have their own space, while you have your own. We know a children\'s playground and trampoline are a must, and for you, there are gym equipment and bicycles available.\r\n. What must be noted is that Villa Diana has a daily cleaning service which is included in the price.\r\nThis new beautiful luxury Villa Diana will provide the guest  pleasure of vacationing in Croatia. The location of this beauty is ideal for visiting Split, Trogir or the National Park.', 20, 39, '1644052675', 43.5424037, 16.1112788, 'Dograde', '10', 'splitsko dalmatinska', '21 222', 'Croatia', 'Marina', '1491,1490,1497,1496,1495,1494,1493,1501,1500,1499,1498,1506,1504,1505,1503,1502,1510,1509,1508,1507,1515,1514,1513,1512,1511,1521,1520,1519,1518,1517,1516,1526,1525,1524,1523,1522,1531,1530', '1540', 9, 4, 5, 260.00, 5, -1, 'per_night', 300.00000, NULL, 'sun', 'a:1:{i:0;a:4:{s:4:\"name\";s:16:\"Security Deposit\";s:11:\"name_unique\";s:16:\"security-deposit\";s:5:\"price\";s:3:\"500\";s:8:\"required\";s:2:\"on\";}}', '4,112,113,114,115,116,120,163,165', '{\"Outdoors\":[\"Private pool\",\"Garden\",\"Quiet area\",\"Outdoor furniture\",\"Sun deck\",\"Terrace\",\"Garden\",\"Outdoor shower\",\"BBQ\",\"Parking\",\"Private parking\",\"Fenced yard\",\"Children playground\"],\"Cooling &amp; Heating\":[\"AC\"],\"Living room\":[\"SAT TV\",\"TV\",\"AC\",\"Couch\",\"Sofa\",\"Corner sofa\",\"Exit to the terrace\"],\"Living room # 2\":null,\"Living room # 3\":null,\"Kitchen\":[\"Fully equipped kitchen\",\"Coffee machine\",\"Oven\",\"Dishwasher\",\"Ice maker\",\"Blender\",\"Toaster\",\"Microwave\",\"Fridge with freezer\",\"Dishwasher\",\"BBQ gas charcoal\",\"Indoor dining area for: 10\",\"Outdoor dining area for: 10\"],\"Bedroom 1\":[\"King size bed\",\"En suit\",\"Terrace\",\"TV\",\"Air condition\",\