(130, 'Villa The Olive Tree', '03-2022-Villa-The-Olive-Tree-Sumartin-Croatia-130', 'The Olive Tree Villa is situated on the hillside of the small fishing village of Sumartin. This villa is surrounded by nature and olive groves and beautiful views of the sea. It is secluded from the town with peaceful and tranquil ambience. There are many hiking trails around the property.\r\n\r\nWalking distance to beaches and centre of town where you will find amenities such as supermarket, restaurants and cafes.\r\n\r\nThis comfortable villa features an infinity heated pool and outdoor living space.\r\nProstor\r\nKitchen is fully equipped, includes cappuccino machine, microwave, dishwasher and plastic cups and plates for outdoor use.\r\n\r\nFamily amenities include infinity heated pool, trampoline, dartboard, board games.\r\nDostupno gostima\r\nThe villa has an organic seasonal vegetable/herb patch which guests can pick at their will for fresh salads, and cooking.\r\n\r\nEach room has their own access to the terrace, garden or balcony.', 'The Olive Tree Villa is situated on the hillside of the small fishing village of Sumartin. This villa is surrounded by nature and olive groves and beautiful views of the sea. It is secluded from the town with peaceful and tranquil ambience. There are many hiking trails around the property.\r\n\r\nWalking distance to beaches and centre of town where you will find amenities such as supermarket, restaurants and cafes.\r\n\r\nThis comfortable villa features an infinity heated pool and outdoor living space.\r\nProstor\r\nKitchen is fully equipped, includes cappuccino machine, microwave, dishwasher and plastic cups and plates for outdoor use.\r\n\r\nFamily amenities include infinity heated pool, trampoline, dartboard, board games.\r\nDostupno gostima\r\nThe villa has an organic seasonal vegetable/herb patch which guests can pick at their will for fresh salads, and cooking.\r\n\r\nEach room has their own access to the terrace, garden or balcony.', 20, 1