(132, 'Villa Amalia', '03-2022-Villa-Amalia-Hvar-Croatia-132', 'Villa Amalia is a classical mixture of modern, Mediterranean and international, presenting the inimitable external architectural solutions, combined with the local tradition and natural beauties. The spot it is situated in, has been selected precisely for its uniqueness, inviting for an unprecedented game of extraordinary colours and materials, combining the warmth of wood and hand carved stone, leaving no one indifferent.\r\n\r\n\r\nIt was built in 2014, on private premises with the surface of over 40 hectares, on the foundations of the ancient farm, which in the past century, provided shelter and safety to farmers working in fields and wine yards surrounding the house. It has been fully functional since 2015.\r\n\r\nThe house is located in the central, rural part of the island, on a hill safeguarding Pokrivenik, one of the most beautiful bays on the island, distant only 30 minutes from Hvar, surrounded by autochthonous vegetation and centennial pine trees. The walk to the Villa seems to be the journey back to old, remote, forgotten times.', 'Villa Amalia is a classical mixture of modern, Mediterranean and international, presenting the inimitable external architectural solutions, combined with the local tradition and natural beauties. The spot it is situated in, has been selected precisely for its uniqueness, inviting for an unprecedented game of extraordinary colours and materials, combining the warmth of wood and hand carved stone, leaving no one indifferent.', 20, 42, '1645513212', 43.15038486569307, 16.838878427722108, 'Hvar', '13', 'Splitsko dalmatinska', '21 450', 'Croatia', 'Hvar', '1826,1821,1822,1825,1824,1823,1827,1828,1830,1832,1831,1829,1836,1837,1835,1834,1833,1838,1840,1839,1841,1842,1843,1844,1846,1845,1848,1850,1849,1852,1851,1856,1853,1855,1854,1858,1859,1860,1', '1826', 10, 5, 5, 400.00, 5, -1, 'per_night', 1000.00000, NULL, 'sun', 'a:0:{}', '4,112,113,114,115,116,120,163,166,168,169'