(134, 'Villa Palace Residence', '03-2022-Villa-Palace-Residence-Kaštel Stari-Croatia-134', 'This amazing villa has a plot of 1500 m2 with a living area of 450 m2 and consists of ground floor, first and second floor, separate relax room with fireplace, billiards and table football and tennis court.\r\n\r\nOutside heated pool has 50 m2 and it is surrounded by sun loungers and parasols, an outdoor shower, an outdoor kitchen with a fireplace and a bread oven, an outdoor dining table and a bar that completes the socializing experience. Relaxing room has a very interesting window overlooking the pool and another large comfortable sofa. On the ceiling there is a projector screen that stretches and provides great enjoyment of watching matches or movies.\r\n\r\nSpacious living room, fully equipped kitchen with island and storage, dining area, children\'s playroom, 5 bedrooms with en suite bathrooms. The villa has one guest toilet and is suitable for 10 + 2 people.\r\n\r\nGROUND FLOOR:\r\nThrough the main entrance, you enter the living room permeated with light ground floor, which consists of a large fully equipped minivan kitchen with island, storage and dining area. There is also a modern living room with comfortable seating and an LCD TV. The sliding walls of the living room and living area allow direct access to the green yard with seating. In addition to the living room there is a room for children to play. In the ground floor of the villa there is a guest toilet.\r\n\r\nFIRST FLOOR:\r\nGround floor and first floor are connected by internal stairs. There are four bedrooms on the first floor. The FIRST BEDROOM has a king size bed, en suite bathroom with shower, extra bed for one person and access to a balcony with outdoor furniture. The SECOND BEDROOM has a king-size bed, an en suite bathroom with a beautiful bathtub and a balcony with a seating area. The THIRD BEDROOM has a king-size bed, an en suite bathroom with a shower and a balcony with a seating area. The FORTH BEDROOM has a king size bed and an en suite bathroom with shower. All beds are high and have the ability to adjust the position of the floor.\r\n\r\nSECOND FLOOR:\r\nIt has a large MASTER ROOM with a king-size bed with adjustments, en suite bathroom with bath and shower, additional comfortable sofa and satellite LCD TV. Also, there is an exit to the spacious terrace which contains sofas and deck chairs, outdoor TV.\r\n\r\nALL rooms are fully air conditioned. The villa has underfloor and wall heating and is ideal for winter stays. The villa has WI-FI and LCD TV. The kitchen contains: dining table with chairs, dishwasher, refrigerator, freezer, wine refrigerator, ice maker, microwave, stove, oven, hood, kettle, juicer, blender, coffee maker. Guests have at their disposal an iron and ironing board, safe, washing machine and dryer, as well as a clothes dryer, 2 baby cots and 2 high chairs. Guests are provided with 3 free parking spaces on the property .', 'This amazing villa has a plot of 1500 m2 with a living area of 450 m2 and consists of ground floor, first and second floor, separate relax room with fireplace, billiards and table football and tennis court.\r\n\r\nOutside heated pool has 50 m2 and it is surrounded by sun loungers and parasols, an outdoor shower, an outdoor kitchen with a fireplace and a bread oven, an outdoor dining table and a bar that completes the socializing experience. Relaxing room has a very interesting window overlooking the pool and another large comfortable sofa. On the ceiling there is a projector screen that stretches and provides great enjoyment of watching matches or movies', 20, 18, '1645528667', 43.550504, 16.344784, 'Kaštel Stari', '13', 'Splitsko dalmatinska', '21216', 'Croatia', 'Kaštel Stari', '1941,1945,1942,1944,1943,1940,1951,1952,1953,1954,1946,1947,1948,1949,1955,1956,1957,1958,1959,1960,1964,1963,1962,1961,1983,1984,1985,1986,1987,1988,1979,1980,1981,1982,1974,1975,1976,1977', '1941', 12, 5, 5, 450.00, 6, -1, 'per_night', 800.00