(149, 'Villa Tara', '03-2022-Villa-Tara-Rogoznica-Croatia-149', 'Amazing near the sea Villa Tara is perfect for family vacation.\r\nVilla Tara is a modern and luxurious villa situated on 500 m2 estate located in Zatoglav, overlooking the town of Rogoznica. \r\nIts ideal for 8 adults + 1 child ,The villa itself has 300 m2, consists of two floors and has a large patio with a pool in front, a summer kitchen on one side, a garden on the other side and parking spaces in the back of the villa.\r\n\r\nThe ground floor of the villa houses three bedrooms with en-suite bathrooms equipped with king size beds, flat screen TVs and air-conditioning. O the second flore is main kitchen and living room with master bedroom.All of these rooms have an exit to a large terrace on the south side of the house and an option of using kitchenette on the entrance of the ground floor.\r\n\r\nThe first floor of the villa has a fully equipped kitchen, dining room and living room and a large terrace with outdoor furniture. Two bedrooms on this floor have en-suite bathrooms, flat-screen TVs and air conditioning. The first floor and the ground floor have separate entrances.\r\n\r\nThis villa is located just a couple of minutes walk from the sea (40 m) and a few minutes drive from the town of Rogoznica.', 'Amazing near the sea Villa Tara is perfect for family vacation.\r\nVilla Tara is a modern and luxurious villa situated on 700 m2 estate located in Zatoglav, overlooking the town of Rogoznica. The villa itself has 300 m2, consists of two floors and has a large patio with a pool in front, a summer kitchen on one side, a garden on the other side and parking spaces in the back of the villa.', 20, 67, '1646645388', 43.531794189566256, 15.982301743393293, 'Zatoglav,Croatia', '13.52477681435829', 'šibensko kninska županija', '22203', 'Croatia', 'Rogoznica', '2146,2145,2150,2151,2147,2149,2148,2152,2153,2154,2155', '2146', 9, 4, 3, 250.00, 6, -1, 'per_night', 300.00000, NULL, 'sun', 'a:0:{}', '4,112,113,11