(1, 'hh_theme_options', 'a:155:{s:9:\"site_name\";s:23:\"Luxury Croatia Retreats\";s:16:\"site_description\";s:114:\"Your dream vacation premium partner! Luxury Croatia Retreats = Best Croatia Villas and experience service partner.\";s:10:\"main_color\";s:7:\"#12A9E7\";s:12:\"header_items\";s:6:\"a:0:{}\";s:15:\"unit_of_measure\";s:2:\"m2\";s:10:\"user_admin\";s:1:\"1\";s:13:\"enable_review\";s:2:\"on\";s:15:\"review_approval\";s:2:\"on\";s:15:\"top_destination\";s:1315:\"a:3:{i:0;a:6:{s:4:\"name\";s:5:\"Split\";s:3:\"lat\";s:10:\"43.5081323\";s:3:\"lng\";s:10:\"16.4401935\";s:7:\"content\";s:266:\"A city full of history, untold stories, and a good evening out. These are just a few reasons to choose a villa near this city. Visit Split one of the most beautiful Croatian cities. Split lies on the Adriatic coast, central Dalmatia, on the Split (Marjan) peninsula.\";s:5:\"image\";s:4:\"1626\";s:7:\"service\";s:0:\"\";}i:1;a:6:{s:4:\"name\";s:8:\"Šibenik\";s:3:\"lat\";s:10:\"43.7350196\";s:3:\"lng\";s:10:\"15.8952045\";s:7:\"content\";s:290:\"One of the most desirable locations for luxury vacations is located in the center of the Adriatic, the city of Sibenik is known for its cultural sights, good food, and beauty. There are so many reasons why to choose your vacation here. Šibenik is surrounded by beautiful beaches and coves.\";s:5:\"image\";s:4:\"1625\";s:7:\"service\";s:4:\"home\";}i:2;a:6:{s:4:\"name\";s:5:\"Brač\";s:3:\"lat\";s:10:\"43.3048913\";s:3:\"lng\";s:10:\"16.6527099\";s:7:\"content\";s:274:\"The island of Brac is a jewel of the Croatian coast. Known for the most beautiful beach Zlatni Rat. This island hides an interesting landscape that you can discover during your vacation. This location provides stunning nature, wonderful food and an unforgettable experience.\";s:5:\"image\";s:4:\"1627\";s:7:\"service\";s:4:\"home\";}}\";s:11:\"testimonial\";s:3178:\"a:7:{i:0;a:5:{s:11:\"author_name\";s:6:\"Lauren\";s:13:\"author_avatar\";s:4:\"1624\";s:14:\"author_comment\";s:152:\"Gorgeous villa, great location, lovely host. Cannot believe how lucky we were to find such an amazing villa. Would definitely stay here again! Loved it!\";s:11:\"author_rate\";s:1:\"5\";s:4:\"date\";s:0:\"\";}i:1;a:5:{s:11:\"author_name\";s:3:\"Sam\";s:13:\"author_avatar\";s:4:\"1624\";s:14:\"author_comment\";s:261:\"Absolutely stunning villa, couldn’t recommend it more highly to anyone else. When we arrived everything was spotless and pool was very clean. Location was well suited as only a 15 minutes Uber/taxi to Split. Will definitely be coming back in the future. FBMA.\";s:11:\"author_rate\";s:1:\"5\";s:4:\"date\";s:0:\"\";}i:2;a:5:{s:11:\"author_name\";s:3:\"Jed\";s:13:\"author_avatar\";s:4:\"1624\";s:14:\"author_comment\";s:421:\"Though hard to believe, this villa is even better in-person than in the pictures. Our guests, my partner, and I were all extremely comfortable, and the villa had every imaginable luxury. We especially enjoyed using the infinity pool and the outdoor kitchen the grill fish for dinner. Split is a fabulous place to visit as well - highly recommend Krka National park and chartering a yacht to see all the beautiful islands.\";s:11:\"author_rate\";s:1:\"5\";s:4:\"date\";s:0:\"\";}i:3;a:5:{s:11:\"author_name\";s:10:\"Abdelkader\";s:13:\"author_avatar\";s:4:\"1624\";s:14:\"author_comment\";s:205:\"Wonderful villa, very luxuous with an amazing view. The pool is amazing, and so is the sauna and jacuzzi, it’s a dream house. The host is very friendly and was super reactive thoughout the stay: amazing.\";s:11:\"author_rate\";s:1:\"5\";s:4:\"date\";s:0:\"\";}i:4;a:5:{s:11:\"author_name\";s:4:\"Paul\";s:13:\"author_avatar\";s:4:\"1624\";s:14:\"author_comment\";s:485:\"This place is fantastic - we have stayed in many villas and this is one of the best. You can’t really want for anything more - really high standard accommodation, fabulous pool are and stunning views! Photos don’t do it justice. While the villa is a bit remote it’s no problem - it’s only about 10 mins by car into Omis which is a cool place, 5 mins by car to beach and lovely beach bar. Having a car would be worth it but we managed easily with cabs. Don’t hesitate to book!\";s:11:\"author_rate\";s:1:\"5\";s:4:\"date\";s:0:\"\";}i:5;a:5:{s:11:\"author_name\";s:8:\"Zvonimir\";s:13:\"author_avatar\";s:4:\"1624\";s:14:\"author_comment\";s:176:\"Very nice location for relaxing days. Great view to sea and Island of Brač. Very large pool, Boccia and billiard for lot of fun.\r\nOnly few minutes by car to Omiš and beaches.\";s:11:\"author_rate\";s:1:\"5\";s:4:\"date\";s:0:\"\";}i:6;a:5:{s:11:\"author_name\";s:4:\"Adam\";s:13:\"author_avatar\";s:4:\"1624\";s:14:\"author_comment\";s:414:\"it was a great stay. the pool was nice & the nights in the village are very calm. the big stove & oven are perfect to cook and bake. the house has everything you need & was very clean. the next village with a supermarket is just 5 minutes away. the description about the boat was a little bit confusing - there is no boat you can drive on your own. but there is the possibility to go on a boat trip with the owner.\";s:11:\"author_rate\";s:1:\"5\";s:4:\"date\";s:10:\"2021-06-01\";}}\";s:13:\"checkout_page\";s:1:\"3\";s:22:\"redirect_checkout_page\";s:1:\"3\";s:19:\"term_condition_page\";s:1:\"4\";s:19:\"call_to_action_page\";s:1:\"4\";s:10:\"currencies\";a:2:{i:0;a:8:{s:4:\"name\";s:3:\"USD\";s:6:\"symbol\";s:1:\"$\";s:4:\"unit\";s:3:\"USD\";s:8:\"exchange\";i:1;s:8:\"position\";s:4:\"left\";s:18:\"thousand_separator\";s:1:\",\";s:17:\"decimal_separator\";s:1:\".\";s:16:\"currency_decimal\";i:2;}i:1;a:8:{s:4:\"name\";s:4:\"EURO\";s:6:\"symbol\";s:4:\" €\";s:4:\"unit\";s:4:\"EURO\";s:8:\"exchange\";d:0.90000000000000002220446049250313080847263336181640625;s:8:\"position\";s:5:\"right\";s:18:\"thousand_separator\";s:1:\".\";s:17:\"decimal_separator\";s:1:\",\";s:16:\"currency_decimal\";i:2;}}s:12:\"included_tax\";s:2:\"on\";s:3:\"tax\";s:2:\"10\";s:16:\"paypal_test_mode\