N;s:16:\"coming_soon_date\";N;s:22:\"coming_soon_background\";N;s:10:\"custom_css\";N;s:18:\"custom_header_code\";s:532:\"<head>\r\n	<meta name=\"description\" content=\"Luxury Croatia Retreats provides Premium Villas in Croatia. The most beautiful luxury villas in Croatia by the sea. Most inspiring villas to rent in Croatia.\">\r\n</head>\r\n<!-- Global site tag (gtag.js) - Google Analytics -->\r\n<script async src=\"https://www.googletagmanager.com/gtag/js?id=G-MM3QSJGY45\"></script>\r\n<script>\r\n  window.dataLayer = window.dataLayer || [];\r\n  function gtag(){dataLayer.push(arguments);}\r\n  gtag(\'js\', new Date());\r\n\r\n  gtag(\'config\', \'G-MM3QSJGY45\');\r\n</script>\";s:18:\"custom_footer_code\";N;s:13:\"smtp_username\";s:31:\"admin@luxurycroatiaretreats.com\";s:13:\"smtp_password\";s:12:\"!QAZxsw2#EDC\";s:11:\"email_alert\";s:0:\"\";s:10:\"email_logo\";N;s:12:\"ical_heading\";s:0:\"\";s:11:\"time_format\";s:5:\"h:i A\";s:11:\"date_format\";s:6:\"d.m.Y.\";s:29:\"alert_paypal_convert_currency\";s:0:\"\";s:10:\"blog_title\";s:24:\"Luxury Villas in Croatia\";s:12:\"blog_content\";s:61:\"Most inspiring villas to  rent in Croatia and supper support.\";s:14:\"sub_blog_title\";s:25:\"Luxury Villas in Dalmatia\";s:16:\"sub_blog_content\";s:598:\"Luxury Croatia Retreats provides Premium Villas in Croatia. With more than 10 + years of working in the Luxury villas business, we are able to respond to all of the client\'s requirements.  The most beautiful luxury villas in Croatia by the sea on the Adriatic coast. Luxury Villas in Croatia. Most inspiring villas to rent in Croatia with supper support. Best price + best offer + best support on the Adriatic coast.\r\nWe find, inspect and test Croatia’s best Villas to rent for you.\r\nWith 200 + Villas to rent in Dalmatia and around the Croatian coastline, we thought you could do with some help!\";s:30:\"home_call_to_action_background\";N;s:36:\"experience_call_to_action_background\";N;s:29:\"car_call_to_action_background\";N;s:12:\"term_rules_1\";s:1302:\"COVID-19 uvjeti otkazivanja\r\nPravo na besplatno otkazivanje uz povrat cjelokupno uplaćenog iznosa dozvoljeno je u slijedećim situacijama:\r\n- Ukoliko gost dostavi potvrdu da zbog pozitivnog testa na COVID-19  nije u mogućnosti iskoristiti svoju rezervaciju.\r\n- Republika Hrvatska ili država prebivališta gosta donesu odluku o zabrani putovanja izvan zemlje ili zabrani ulaska u zemlju\r\n- Ukoliko država iz koje gost dolazi donese odluku o obveznoj karanteni po povratku iz Hrvatske,  pod uvjetom da takva odluka nije postojala u trenutku ugovaranja rezervacije.\r\nOvi uvjeti se ne odnose na goste:\r\n- koji su u vrijeme rezervacije bili upoznati s postojećim ograničenjima COVID-19 u vezi s rezerviranim terminom.\r\n- čija država prebivališta je donijela samo preporuke ponašanja bez izričite odluke ili zabrane.\r\n\r\nUvjeti plaćanja rezervacije\r\nZa potrebe potvrde rezervacije gost je dužan uplatiti minimalno 40 % od ukupnog iznosa rezervacije.\r\nPreostali iznos gost je dužan uplatiti najkasnije 45 dana prije dolaska.\r\nUkoliko gost bez opravdanog razloga u skladu s pravilima otkazivanja ne uplati preostali iznos 45 dana prije dolaska, gubi pravo na povrat akontacije.\r\nUkoliko gost napravi rezervaciju unutar 45 dana prije dolaska gost je obvezan uplatiti cjelokupni iznos rezervacije.\";s:12:\"term_rules_2\";s:1109:\"Stroga pravila otkazivanja:\r\nNakon uplate rezervacije gost nema pravo na povrat novca osim u izvanrednim okolnostima.\r\nPod izvanrednim okolnostima podrazumijevaju se:\r\nVojne operacije i drugi oblici neprijateljskog djelovanja. Ratne aktivnosti, neprijateljsko djelovanje, invazije, građanski rat, terorizam, eksplozije, bombaški napadi, pobune, neredi, revolucije, građanski neredi i građanski nemiri.\r\nElementarne nepogode. Elementarne nepogode, prirodne katastrofe, prekidi opskrbe osnovnim komunalnim uslugama koji zahvaćaju šira područja, vulkanske erupcije, tsunamiji i druge teške i neuobičajene vremenske nepogode.\r\n Uvjeti plaćanja rezervacije\r\nZa potrebe potvrde rezervacije gost je dužan uplatiti minimalno 40 % od ukupnog iznosa rezervacije.\r\nPreostali iznos gost je dužan uplatiti najkasnije 45 dana prije dolaska.\r\nUkoliko gost bez opravdanog razloga u skladu s pravilima otkazivanja ne uplati preostali iznos 45 dana prije dolaska, gubi pravo na povrat akontacije.\r\nUkoliko gost napravi rezervaciju unutar 45 dana prije dolaska gost je obvezan uplatiti cjelokupni iznos rezervacije.\";s:15:\"term_rules_en_1\";s:670:\"<p style=\"text-align:center\"><strong>COVID-19 cancellation policy</strong></p>\r\n\r\n<p><strong>The right to cancel reservation with a full refund is allowed in the following situations:</strong></p>\r\n\r\n<p>- If the guest submits a confirmation that due to a positive test on COVID-19 he is not able to use his reservation.</p>\r\n\r\n<p>- The Republic of Croatia or the country of residence of the guest makes a decision to ban travel outside the country or ban entry into the country</p>\r\n\r\n<p>- If the country from which the guest comes makes a decision on mandatory quarantine upon return from Croatia, provided that such a decision did not exist at the time of booking.</p>\";s:15:\"term_rules_en_2\";s:444:\"<p style=\"text-align:center\"><strong>Strict cancellation rules:</strong></p>\r\n\r\n<p>After paying the reservation, the guest is not entitled to a refund except in extraordinary circumstances.</p>\r\n\r\n<p>Extraordinary circumstances include:</p>\r\n\r\n<p>Military operations and other forms of enemy action. War activities, hostilities, invasions, civil war, terrorism, explosions, bombings, riots, riots, revolutions, civil riots and civil unrest.</p>\";s:24:\"term_rules_en_1_loadmore\";s:982:\"<p><strong>These conditions do not apply to guests:</strong></p>\r\n\r\n<p>- who were aware at the time of the reservation of the existing restrictions of COVID-19 regarding the reserved term.</p>\r\n\r\n<p>- whose country of residence has issued only recommendations of conduct without an explicit decision or prohibition.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p style=\"text-align:center\"><strong>Terms of booking payment</strong></p>\r\n\r\n<p>For the purpose of booking confirmation, the guest is obliged to pay a minimum of 40% of the total amount of the reservation.</p>\r\n\r\n<p>The guest is obliged to pay the remaining amount no later than 45 days before arrival.</p>\r\n\r\n<p>If the guest does not pay the remaining amount 45 days before arrival without a justified reason in accordance with the cancellation rules, he loses the right to a refund of the advance.</p>\r\n\r\n<p>If the guest makes a reservation within 45 days before arrival, the guest is obliged to pay the full amount of the reservation.</p>\";s:24:\"term_rules_en_2_loadmore\";s:873:\"<p>Natural disasters. Natural disasters, natural disasters, interruptions in the supply of basic utilities affecting wider areas, volcanic eruptions, tsunamis and other severe and unusual weather disasters.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p style=\"text-align:center\"><strong>Terms of booking payment</strong></p>\r\n\r\n<p>For the purpose of booking confirmation, the guest is obliged to pay a minimum of 40% of the total amount of the reservation.</p>\r\n\r\n<p>The guest is obliged to pay the remaining amount no later than 45 days before arrival.</p>\r\n\r\n<p>If the guest does not pay the remaining amount 45 days before arrival without a justified reason in accordance with the cancellation rules, he loses the right to a refund of the advance.</p>\r\n\r\n<p>If the guest makes a reservation within 45 days before arrival, the guest is obliged to pay the full amount of the reservation.</p>\";}'),
