(4, 'Terms & Conditions', 'terms-conditions', '<p>GENERAL TERMS AND CONDITIONS OF SERVICE</p>\r\n\r\n<p>The following General Terms define the conditions under which the contracting party/customer/client (hereinafter referred to as: Client) uses the services of Luxury Croatia Retreats&nbsp; sal mare j.d.o.o., represented by the director Hrvoje Parlov (hereinafter: Travel Agency).<br />\r\nWhen accessing, using or obtaining any content or service through our office or through our web site, the Client assumes all the obligations arising from these terms and conditions.<br />\r\nFor reservations where accommodation services are offered, Travel agency contractually performs as an Intermediary, while in the cases in which it organizes the provision of additional services, Travel Agency acts as the Organizer.</p>\r\n\r\n<p>TERMS OF RESERVATION AND METHOD OF PAYMENT</p>\r\n\r\n<p>When reviewing the contents or services through our web site (www.luxurycroatiaretreats.com), the client has all relevant information regarding the selected service, and he is obligated to provide all the information required by the reservation process.<br />\r\nBy accepting these conditions, the Client confirms that he is aware that there is no single model of payment for services offered. The payment model/s are specified for each and every individual service with which the Client will be informed on the Travel Agency&rsquo;s website while creating a reservation.<br />\r\nUpon arrival, the Client is obliged to submit a payment confirmation for the paid service (the confirmation of reservation received via e-mail or on the Travel Agency&rsquo;s website) if it is paid in full before the arrival. If the Client chooses the payment model in which he pays a part of the price on the day of his arrival, he will pay the predetermined amount upon arriving in his accommodation unit. Prices in Euros will be converted into Croatian Kuna according to the Croatian National Bank conversion rate on the day of payment.</p>\r\n\r\n<p>PRICE OF SERVICE</p>\r\n\r\n<p>The basic service includes the basic price of the accommodation unit as described in the price list on the on the page of a selected vacation rental.<br />\r\nOwners of certain vacation rentals have the right to require the calculation of surcharge for certain additional services, such as: final cleaning, insurance and one-time registration.<br />\r\nVacation rental owners have the right to require you to pre-pay a security deposit that serves solely for the purpose of insuring the owner against any damage, unpaid additional services, etc. which you may have during your stay.<br />\r\nThe amount of the surcharge and the type of additional service will be visible on the reservation confirmation issued by the Travel Agency.<br />\r\nTravel Agency and the vacation rental owner will inspect the accommodation unit. If possible, the inspection will be carried out before the Client leaves the property on the day of his departure to determine the condition of the accommodation unit, and in case of damage, determine and collect the fee. However, if this is not possible due to early/late departures of the Client, the inspection will be performed without the presence of the Client on the day of departure, and the compensation for any damages will be made no later than one week after departure.<br />\r\nIf the damage determined exceeds the amount of the security deposit, the Client is responsible for the full cost of the damage.<br />\r\nBy confirming the reservation, the Client agrees that, in the event of a non-existent security deposit obligation, the Client will pay compensation for any damages on the spot.<br />\r\nThere are services which are offered that are not included in the basic price, but can be performed with the prior announcement to the Travel Agency, with additional payment to the service provider. For such services, the Client pays on the spot, in cash, in accordance with the payment instructions specified in the offer by the Travel Agency.<br />\r\nAll prices are published in Euros and the Travel Agency reserves the right to change those prices. The Travel Agency guarantees for the price of accommodation unit specified when the reservation is created.<br />\r\nThe prices stated in the Travel Agency&rsquo;s offer are determined in accordance to the agreement between the Travel Agency and vacation rental owners and/or service providers. Those prices do not have to correspond to the prices published in the vacation rental in which the Client is residing, and any difference in price can not be the subject of a complaint.</p>\r\n\r\n<p>TRAVEL AGENCY AND CLIENT RIGHTS AND OBLIGATIONS</p>\r\n\r\n<p>All services offered by the Travel Agency are advertised on the basis of the information received from the service provider and/or vacation rental owner, and it is the Travel Agency&rsquo;s duty to provide the Client with all relevant information about the services published.<br />\r\nIn cases when it acts as an Organizer, the duty of the Travel Agency is the care for the implementation of reserved services, and the care for the rights and interests of the Client. As the Organizer, the Travel Agency will fulfill all these obligations completely, not including case of exceptional circumstances that are unexpected, extraordinary and unpredictable (e.g. natural disasters, death, serious illness, etc.).</p>\r\n\r\n<p>CHANGE OR CANCELLATION OF RESERVATION</p>\r\n\r\n<p>In case of exceptional circumstances, the Travel Agency reserves the right to change the reservation.<br />\r\nThe Travel Agency reserves the right to make changes to reservations, but only on the condition that the Client is informed in a timely manner and that the replacement reservation is of the same or higher category and that the price of the replacement reservation corresponds to the price at which the Client confirmed the reservation.<br />\r\nIn case of not being able to replace the paid reservation, the Travel Agency reserves the right to cancel the reservation, with prior notice to the Client, before the usage of the service begins. The Travel Agency guarantees the return of the full amount paid, where the Client has no right to claim damages from the Travel Agency.<br />\r\nAny change or cancellation of a reservation can be made by the Client, only in writing, to the Travel Agency and in accordance with the terms of the reservation change/cancellation that are presented to the Client for each individual accommodation unit/service when creating a reservation on the Travel Agency&rsquo;s website. Terms of change/cancellation can vary for individual services or accommodation units.</p>\r\n\r\n<p>LIABILITY FOR DEFICIENCIES OR DAMAGE</p>\r\n\r\n<p>If the Client detects any problems (defects, damages, deficiencies or differences from the reserved service) on arrival, he shall immediately report to the Travel Agency in order to avoid misunderstandings after the expiration of the reservation period or during the inspection of the vacation rental.<br />\r\nBy confirming the reservation, the Client agrees that in the event of any defects in the paid and used service his claim will be exclusively to the service provider/vacation rental owner, and not to the Travel Agency.<br />\r\nBy confirming the reservation, the Client is obliged, if he causes any damage, to pay all damages caused to the service provider/vacation rental owner on the spot.</p>\r\n\r\n<p>HOUSEHOLD RULES</p>\r\n\r\n<p>The following rules are prepared according to the instructions of the vacation rental owners and they express their will.<br />\r\nThe client is obliged to comply with the household rules within the accommodation unit, and when arriving at the destination, cooperate with vacation rental owners in accordance with the conditions of the reservation and security conditions.<br />\r\nWhen choosing a accommodation unit and creating a reservation, the Client is obliged to notify the Travel Agency without any delay, of the intention to have more persons in the accommodation unit than the stated capacity. The possibility of accepting more persons than the capacity states, depends exclusively on the good will of the vacation rental owner, which does not exclude the possibility of additional payment for additional persons.<br />\r\nIf the service provider determines at any time, that the number of persons residing in the vacation rental is higher than the stated capacity, without his approval, the services provider has the right to cancel the reservation,&nbsp;in which case the Client has no right to a complaint or refund of the paid amount.<br />\r\nThe Client can not bring a pet into the accommodation unit without prior notice to the Travel Agency or vacation rental owner, otherwise the vacation rental owner reserves the right to deny the reservation.<br />\r\nWhen booking an accommodation unit, the Client is obliged to clean the accommodation unit before departure, which includes washing and stowing of dishes, removal of garbage from the so that the vacation rental is returned tidy to the owner.<br />\r\nIn the case of not fulfilling these obligation, the Travel Agency shall not be obliged to accept the Client&rsquo;s remarks on the quality of the booked accommodation unit or services.</p>\r\n\r\n<p>TOURIST TAX</p>\r\n\r\n<p>Each Client who chooses to organize his vacation through the Travel Agency does not need to pay the residence tax.</p>\r\n\r\n<p>SUBMISSION OF COMPLAINTS</p>\r\n\r\n<p>A client who has made a reservation through the Travel Agency, as a contracting party, has the right to file an objection.<br />\r\nThe complaint is submitted by mail to Luxury Croatia Retreats - Sal mare j.d.o.o., Drage Markovića 58, 21 209 Kučine, Mravince or by e-mail &nbsp;The Travel Agency is obliged to reply within fifteen days from the date of receiving the complaint.<br />\r\nThe Client is obliged to fully cooperate with the Travel Agency and the Service Provider and/or vacation rental owner when considering the objection, and the Client is obliged to provide additional information and evidence to the request of the Agency for the purpose of successfully resolving the complaint.<br />\r\nThe client does not have the right to refuse the reserved service on his own initiative (leave the accommodation unit before the end of reserved period or refuse a service reserved through the Travel Agency), and in the case of self-initiative actions, the Client waives the right to a subsequent complaint, a refund and a claim for damages.<br />\r\nIf the Client discovers any problems during the arrival/use of the service, he/she shall submit a complaint with the Agency within 24 hours of the arrival/use of service. If the Client does not file a complaint in accordance with the above conditions, the Agency will not consider such complaint.</p>\r\n\r\n<p>FINAL REMARKS</p>\r\n\r\n<p>The Client confirms his/her express consent to the above conditions.<br />\r\nIf it is not possible to settle disputes between the Travel Agency and the Client, by agreement and peacefully, the jurisdiction of court in Split is determined.</p>', '588', 'default', 'publish', '1578392345', 0, 'page'),
(5, 'New Page - 1638121550', 'new-page-1638121550', NULL, NULL, NULL, 'revision', '1638121550', 7, 'page'),
(6, 'About us', 'about-us', '<p style=\"text-align:center\">The vision was a new way of traveling and simplicity which led us to this project. We are a team of young professional in Croatian tourisim.</p>\r\n\r\n<hr />\r\n<p>Guided by the motto everything in the palm of your hand, we have created a unique platform for Luxury retreats in Croatia.</p>\r\n\r\n<p>Through years of experience in renting Luxury Villas, we believe that we have realized what our guest needs to make their trip as pleasant as possible and the experience itself as good as possible.</p>\r\n\r\n<p><strong>And why choose us?</strong></p>\r\n\r\n<p>We offer simplicity of booking a luxury villa, transparency, 100% security and super support.</p>\r\n\r\n<p>Through the offer on our website, everyone can find something for themselves whether it is a luxury beachfront villa or country side villa, if you can not find on our website what you like you can contact your agent through our application for help.<br />\r\n&nbsp;<br />\r\nAll villas in Croatia advertised through us have been personally seen and verified by the agent to match with pictures online. The same agent who accompanies you during your booking and travel.</p>\r\n\r\n<p>That&#39;s us<br />\r\n<strong>Luxury Croatia Retreats</strong></p>', '581', 'default', 'publish', '1641894927', 9, 'page'),
(7, 'Privacy policy', 'privacy-policy', '<p>1. GENERAL</p>\r\n\r\n<p>SALMARE j.d.o.o.,(hereinafter referred to as &ldquo;the Administrator&rdquo;) which manages the website luxury croatia retreats&nbsp; (hereinafter referred to as &ldquo;the Site&rdquo;), is aware of the importance of protecting personal data and privacy.</p>\r\n\r\n<p>Personal Data Protection in Croatia is systematically regulated by the General Data Protection Regulation (EU) 2016/679 defining rights, obligations, principles and measures to prevent unlawful and unjustified practices with the privacy and dignity of the individual in processing personal data.</p>\r\n\r\n<p>2. PERSONAL DATA PROTECTION</p>\r\n\r\n<p>In accordance with the statutory provisions of the General Data Protection Regulation (EU) 2016/679, the Administrator respects your right to privacy by affirming that:</p>\r\n\r\n<ul>\r\n	<li>personal data and information are sent to the Administrator willingly, and he is allowed to process that data;</li>\r\n	<li>the personal data and information you provided to the Administrator will never be used without your consent, or in any way to deliver to third parties or otherwise used in a manner that would violate the law;</li>\r\n	<li>the Administrator does not require that you share sensitive personal information as defined in the General Data Protection Regulation (GDPR) (EU) 2016/679;</li>\r\n	<li>the provided information will be used by the Administrator legally and solely for the purposes associated with his / her work, that is, for the purpose of executing a service, of which he notifies you on the Site;</li>\r\n	<li>after the fulfillment of the purpose for which the personal data is used, the data will be archived for as many years as prescribed by the laws determining the operation of our services;</li>\r\n	<li>personal data used for the purposes of web site services are appropriate and consistent with what is appropriate for collection purposes;</li>\r\n	<li>You personally enter your personal data and information and you have the right to review, update, correct, block, and delete the same as explained in the Privacy Policy section: HOW CAN YOU MANAGE YOUR DATA below.</li>\r\n</ul>\r\n\r\n<p>3. WHO REVIEWS YOUR DATA</p>\r\n\r\n<p>Your data is processed and reviewed by the management teams from the company:</p>\r\n\r\n<p>Luxury Croatia Retreats</p>\r\n\r\n<p>Sal Mare j.d.o.o.</p>\r\n\r\n<p>Drage Markovića 58,</p>\r\n\r\n<p>21209 Kučine,</p>\r\n\r\n<p>Mravince</p>\r\n\r\n<p>Croatia</p>\r\n\r\n<p>Director: Hrvoje Parlov</p>\r\n\r\n<p>4. WHERE IS YOUR DATA STORED</p>\r\n\r\n<p>Your data is stored in self-managing databases and third-party databases:</p>\r\n\r\n<ul>\r\n	<li>Luxury Croatia Retreats dashboard (Administrator database)</li>\r\n	<li>Contact Form 7 (Administrator database)</li>\r\n	<li>MailChimp (Administrator database)</li>\r\n	<li>Google (third-party databases)</li>\r\n	<li>Facebook (third-party databases)</li>\r\n	<li>PayPal (third party database)</li>\r\n</ul>\r\n\r\n<p>All third-party databases are in compliance with the General Data Protection Regulation (GDPR) (EU) 2016/679. We do not share database data with any other third party.</p>\r\n\r\n<p>5. WHICH DATA DO WE COLLECT</p>\r\n\r\n<p>For our services we collect the following data:</p>\r\n\r\n<p>Required information:</p>\r\n\r\n<ul>\r\n	<li>Name and Surname</li>\r\n	<li>Phone number</li>\r\n	<li>E-mail</li>\r\n	<li>Check in date</li>\r\n	<li>Check out date</li>\r\n	<li>Number of people</li>\r\n</ul>\r\n\r\n<p>Optional information:</p>\r\n\r\n<ul>\r\n	<li>Full address</li>\r\n	<li>Country of origin</li>\r\n	<li>VAT number</li>\r\n</ul>\r\n\r\n<p>For marketing purposes we collect the following data:</p>\r\n\r\n<ul>\r\n	<li>Name and Surname</li>\r\n	<li>E-mail</li>\r\n	<li>Telephone number</li>\r\n	<li>Interest in a specific service/s</li>\r\n</ul>\r\n\r\n<p>6. HOW DO WE USE YOUR DATA</p>\r\n\r\n<p>The Administrator agrees that he will not deliver, borrow or sell your information to a third party without prior notice and obtaining written consent of an individual.</p>\r\n\r\n<p>For commercial or operational purposes, the manager uses a double opt-in application, which means that he only sends emails to those who explicitly agreed to receive emails from the Site. Using a special computer system that is protected from spam or password abuse, the Administrator reduces the possibility for a third party to misuse personal information of an individual.</p>\r\n\r\n<p>7. HOW LONG DO WE STORE YOUR DATA</p>\r\n\r\n<p>Your data is kept for as long as the laws regulating the operation of our services prescribe it&rsquo;s storage.</p>\r\n\r\n<p>Luxury Croatia Retreats dashboard (database): forever or until deleted (subscription termination</p>\r\n\r\n<p>MailChimp (database): forever or until deleted (subscription termination)</p>\r\n\r\n<p>All third-party databases have their own system of data retention periods. Learn more about this by checking our Privacy Policy for third-party databases.</p>\r\n\r\n<p>8. HOW CAN YOU MANAGE YOUR DATA</p>\r\n\r\n<p>Once you have shared your data with the Luxury Croatia Retreats&nbsp; database, you can always delete them as follows:</p>\r\n\r\n<p>Type of data: Commercial offers</p>\r\n\r\n<p>Each commercial material includes the subscription button at the bottom of the message. By suspending the subscription your data will be deleted from our database.</p>\r\n\r\n<p>Type of data: Booking/Reservation information</p>\r\n\r\n<p>You can always contact Luxury Croatia Retreats team to remove your information from the Luxury Croatia Retreats dashboard by emailing us at our official email address: info@luxurycroatiaretreats.com with the request: &ldquo;Please delete and remove all personal information associated with my e-mail address. &ldquo;</p>\r\n\r\n<p>9. MONITORING WEB SITE USERS</p>\r\n\r\n<p>When you search a web site and you are not logged in to any online service, you search it anonymously. As you search, your Personal Information Administrator does not collect any data. However, it monitors how the website is used, both by registered as well as anonymous users. One of the tracking methods we use is known as a &ldquo;cookie&rdquo;. Cookies are identifiers that are written on your computer&rsquo;s hard drive, which will be recognized on the your next visit to the site without you registering. Cookies can not access data from your hard drive, download computer viruses, or any other personal information.</p>\r\n\r\n<p>The website uses the following cookie providers:</p>\r\n\r\n<ul>\r\n	<li>Google Analytics (Third Party Cookies)</li>\r\n	<li>Facebook Pixel (Third Party Cookies)</li>\r\n	<li>Google Adwords (Third Party Cookies)</li>\r\n</ul>\r\n\r\n<p>10. WEB SITE SAFETY PROPERTIES</p>\r\n\r\n<p>The Administrator is aware of the importance of security and hence strives to protect your personal information. Unauthorized access, use and disclosure are prevented by many security procedures and technologies. The personal information you enter on the Site is stored in restricted access systems in a controlled environment.</p>\r\n\r\n<p>11. LINKS TO THE OTHER PAGES</p>\r\n\r\n<p>Other websites whose links are our website (external hyperlinks) may include privacy policies that are different from our Privacy Policy. To help protect your privacy, we encourage you to review the Privacy Policy on those sites that you can access through our website.</p>\r\n\r\n<p>12. HOW YOU CAN CONTACT US</p>\r\n\r\n<p>Luxury Croatia Retreats</p>\r\n\r\n<p>Sal Mare j.d.o.o.</p>\r\n\r\n<p>Drage Markovića 58,</p>\r\n\r\n<p>21209 Kučine,</p>\r\n\r\n<p>Mravince</p>\r\n\r\n<p>Croatia</p>\r\n\r\n<p>Director: Hrvoje Parlov</p>\r\n\r\n<p>e-mail: info@luxurycroatiaretreats.com</p>\r\n\r\n<p>We will try to respond as soon as possible. This Privacy Policy applies from the moment it was posted on the website&nbsp;</p>', '587', 'default', 'publish', '1641896169', 9, 'page'),
(8, 'Za vlasnike', 'za-vlasnike', '<p style=\"text-align:justify\"><strong>OGLASITE SE JO&Scaron; DANAS</strong></p>\r\n\r\n<p style=\"text-align:center\"><strong>Luxury Croatia Retreats</strong> je platforma koja Vam nudi drugačiji način ogla&scaron;avanja.</p>\r\n\r\n<p style=\"text-align:justify\">Oslu&scaron;kujući želje na&scaron;ih gostiju u potrazi smo isključivo za vrhunskim smje&scaron;tajem na na&scaron;oj obali. Oglasite se jo&scaron; danas i neka va&scaron;a vila bude dio ekskluzivne ponude najatraktivnijih smje&scaron;taja u Hrvatskoj. Na&scaron; tim vrhunskih agenta procjenjuje svaku vilu radi autentičnosti uvedenih podataka na oglasu, radi sprječavanja neovla&scaron;tenog dupliciranja oglasa te ogla&scaron;avanja isključivo smje&scaron;taja visoke kategorije.</p>\r\n\r\n<p style=\"text-align:justify\">Nakon &scaron;to ste unijeli sve podatke za Va&scaron; objekt, u roku od 3 radna dana kontaktirati će Va&scaron; nadležni agent radi verifikacije i on line ogla&scaron;avanja Va&scaron;eg objekta.</p>\r\n\r\n<p style=\"text-align:justify\">Uzeli smo u obzir i činjenicu da svaki vlasnik najbolje poznaje svoju vilu i mjesto u kojem se nalazi, zato se oglasite na na&scaron;oj platformi gdje jedino imate mogućnost sami kreirati svoj oglas, postavljati slike, postavljati cijene va&scaron;eg smje&scaron;taja, mijenjati cijene, dodavati popuste, a sve to uz automatsku sinkronizaciju va&scaron;ih kalendara te uz stručnu pomoć na&scaron;ih agenata za &scaron;to uspje&scaron;niju prodaju i na obostrano zadovoljstvo.</p>\r\n\r\n<p style=\"text-align:justify\">Nakon &scaron;to ste oglasili svoj objekt prema vlastitim željama va&scaron; posao je zavr&scaron;en. Od tog trenutka cjelokupan posao preuzima na&scaron; stručni tim. Za vas obavljamo besplatan marketing, ogla&scaron;avanje na dru&scaron;tvenim mrežama, kompletnu korespondenciju s gostima i naplatu.</p>\r\n\r\n<p style=\"text-align:justify\">Oglasite se jo&scaron; danas preko Luxury Croatia Retrets platforme i ostvarite besplatno ogla&scaron;avanje bez ugovorne obveze i uz najpovoljniju naknadu za ostvarenu rezervaciju.</p>\r\n\r\n<p style=\"text-align:justify\"><strong>Va&scaron; Luxury Croatia retrets tim</strong></p>\r\n\r\n<p style=\"text-align:center\"><a href=\"https://luxurycroatiaretreats.com/public/ownersapp.apk\"><strong>PREUZMITE APLIKACIJU ZA ADMINISTRACIJU VA&Scaron;EG SMJE&Scaron;TAJA</strong></a></p>\r\n\r\n<p style=\"text-align:center\"><a href=\"javascript: showOwnerModal();\">REGISTRIRAJTE SE</a></p>', NULL, 'default', 'publish', '1643450237', 9, 'page'),
(10, 'Good to know', 'good-to-know', '<p><strong>HOW TO BOOK?</strong></p>\r\n\r\n<p>Luxury Croatia Retreats is a platform for finding luxury villas in Croatia.</p>\r\n\r\n<p>Once you have found a villa on our search engine that suits you according to your needs, all you need to do is choose the dates and number of guests.</p>\r\n\r\n<p>It depends on the villa whether you can instant book or book on-demand.</p>\r\n\r\n<p>The first step is to fill out a form with personal information and then choose the type of payment. When the payment is over, you will receive automatic confirmation to the email you previously entered in the form. Then your reservation is confirmed via Luxury Croatia Retreats.</p>\r\n\r\n<p><strong>HOW TO PAY?</strong></p>\r\n\r\n<p>The Luxury Croatia Retreats system allows payment via bank transfer, credit card or Pay Pal</p>\r\n\r\n<p><strong>CAN I CHANGE MY RESERVATION?</strong></p>\r\n\r\n<ul>\r\n	<li>CHANGE DATE OF ARRIVAL AND DEPARTURE</li>\r\n</ul>\r\n\r\n<p>If you have made a reservation and want to change the date of arrival or departure within 48 hours from the date of reservation, you are free to change the date if the villa has a free date that interests you.</p>\r\n\r\n<ul>\r\n	<li>CHANGE THE NUMBER OF PEOPLE</li>\r\n</ul>\r\n\r\n<p>Changing the number of guests is allowed if the number of people is not over the number which that villa can host and&nbsp; which is written on the page Luxury Croatia Retreats.</p>\r\n\r\n<p><strong>CAN I CANCEL MY RESERVATION?</strong></p>\r\n\r\n<p>Luxury Croatia Retreats has two types of cancellation policies:</p>\r\n\r\n<p>If you meet the conditions for free cancellation, you must submit by e-mail or through the application evidence that you are entitled to free cancellation.</p>\r\n\r\n<p>If you do not meet the conditions of the above two cancellation policies, you do not meet the conditions for a refund.</p>\r\n\r\n<p><strong>HOW CAN I RECEIVE MY REFUND FOR MY CANCELATION</strong></p>\r\n\r\n<p>If you meet the conditions for a refund, Luxury Croatia Retreats will refund your money within 15 days from the date of the request for a refund.</p>\r\n\r\n<p>Refunds will be made using the same payment system you selected at the time of booking.</p>\r\n\r\n<p><strong>I NEED SOME RECOMMENDATIONS</strong></p>\r\n\r\n<p>If you need a recommendation on what to see where to rent a boat, car, yacht or simply which National Park to visit.</p>\r\n\r\n<p>For all these questions you have your agent who is at your service during the booking and during your vacation in Croatia. The assigned agent is always the same from the first day you make the reservation. So you don&rsquo;t need to meet a new agent every time</p>\r\n\r\n<p>To make it easier to use this service, you have a Log in to Luxury Croatia Retreats.&nbsp;</p>\r\n\r\n<p><strong><a href=\"https://luxurycroatiaretreats.com/auth/login\">Click here</a></strong></p>\r\n\r\n<p><strong>MY CONFIRMATION</strong></p>\r\n\r\n<p>You will receive a confirmation of the reservation immediately after the payment is made. Confirmation will be sent to the email you previously entered at the time of booking.</p>\r\n\r\n<p><strong>DO YOU STILL NEED HELP?</strong></p>\r\n\r\n<p>If you still have questions and we have not been able to give you all the information. Please feel free to contact us at: <a href=\"mailto:info@luxurycroatiaretreats.com?subject=New%20inquiry\">info@luxurycroatiaretreats.com</a></p>', NULL, 'default', 'publish', '1643614241', 9, 'page'),
