(30, 'Why choose a luxury vacation near Split?', 'why-choose-a-luxury-vacation-near-split', '<h3 style=\"text-align:center\">By choosing a luxury vacation near Split, you get not only a vacation but an unforgettable journey through intriguing history.</h3>\r\n\r\n<h3 style=\"text-align:center\"><strong>WELCOME TO SPLIT- THE MAGNIFICENT EMPERORS TOWN</strong></h3>\r\n\r\n<p style=\"text-align:center\">&nbsp;</p>\r\n\r\n<p>,,The most beautiful boardwalk shines under the golden sun, small on the planet but the biggest in the heart.&#39;&#39; The amazing author and composer Oliver Dragojević once sang these lovely words about the biggest dalmatian city &ndash; Split.</p>\r\n\r\n<p>The second biggest city in Croatia, blue jewel of the Adriatic, a place that can never be forgotten once you have enjoyed it. Many people compare it with some of the most beautiful cities in Italy and Spain. An emperors town, more than 1700 years old is known all around the world.&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</p>\r\n\r\n<p>A great emperor Dioklecijan (Diocletian) lived about 5 kilometers from Split in ancient Salona. He decided to build a mansion by the sea where he could spend the last few years of his life. He has build a magnificent rectangle shaped palace and today it is under a UNESCO protection. The most amazing fact is that some people still live inside the palace walls. Why did such a great emperor decided to build this spectacular mansion exactly on this spot? Mild weather, termal water sources, a huge amount of stone from the island of Brač, amazing location by the sea&hellip; these are just some of the reasons.&nbsp; The palace &nbsp;&nbsp;has four entrances: golden gate (north), silver gate (east), iron gate (west) and brass gate (south). Long ago, life began inside these walls and was spreading ever since.</p>\r\n\r\n<p>You have probably heard of the sphinx, a mythical creature who gave people riddles once they passed by. Diocletian was fascinated by the egyptian culture so he brought sphinx from Egypt to Split. Today they are placed inside the palace walls - on Peristil and in front of the Jupiter&#39;s temple. The palace had two main streets that are crossing over on the amazing Peristil, perfectly preserved. There is a cathedral of saint Duje and its spectacular belfry on the left and it used to be emperors mausoleum. Saint Duje is a protector of the city and people celebrate his day on 7th of May. A huge amount of people come to Split that day. The city is filled with music and events. On the right side of the Peristil there is a Jupiters temple.</p>\r\n\r\n<p>There is also another amazing and probably the most interesting place to visit- palace basement. You can go in from Peristil or from the sea side. It is just under the emperors home and has so many rooms inside. Walking through this rooms will make you feel like you got back to the past. It has a lot of well preserved remains inside and it is a good shelter from the summer heat. There are so many cultural events oraganized inside, as well as fairs, gastronomic and oenology events and exibitions. You can also see a lot of souvenir shops and bring some of them back to your home. Game of Thrones lovers will be happy to know that basement was one of the filming locations (where Daenerys kept her dragons).</p>\r\n\r\n<p>Another interesting and beautiful place to see is Vestibul which used to be an emperors lobby. It is round shaped and has amazing acoustics inside. That is why you can go there to listen some of the most beautiful female and male vocals.</p>\r\n\r\n<p>The amazing thing about Split is that every ancient element is available for tourists to visit every day.</p>\r\n\r\n<p>Can you imagine eating the most amazing and delicious food or drinking top quality wines inside a thousand years old palace? Sitting on the ancient stairs while the light summer breeze touches your skin? Listening to some lovely music coming from every corner of the old narrow streets? It is all possible if you come to Split.</p>', '1999', 'publish', 9, '1643622937', 'post'),
(31, 'New Post - 1643712183', 'new-post-1643712183', '', '', 'revision', 7, '1643712183', 'post'),
(32, 'Your Luxury vacation in Šibenik', 'your-luxury-vacation-in-sibenik', '<p><strong>What can you expect?</strong></p>\r\n\r\n<p><em>Let&#39;s explore &Scaron;ibenik together</em></p>\r\n\r\n<p>Unforgettable adventure and vacation, that is the city of &Scaron;ibenik. Walking through the old city alleys will take you back to a different period of time and give you so many beautiful memories.</p>\r\n\r\n<p>Just like so many dalmatian cities in the past, &Scaron;ibenik was under the occupation of the Ottomans which made people build great fortresses on the land and the sea. Today they are historical monuments you can visit daily. They are all higher above the ground so they are providing an amazing view of the old city walls and islands.</p>\r\n\r\n<p>The most famous and visited one is the fortress of Saint Michael (Mihovil), 70 meters above the ground, specially renovated for its visitors. There are two tanks from the 15th century inside, today projecting a 3D map of &Scaron;ibenik&#39;s history. There is also a summer stage inside the walls that offers a lot of educational, cultural, and music events. The other extremely interesting and meaningful fortress is the fortress of saint Nicolas (Nikola) placed in the sea channel called saint Anthony (Ante). It is a proud keeper of &Scaron;ibenik and it takes about thirty minutes to get there by boat. It is one of two UNESCO-protected monuments in &Scaron;ibenik. It has a hidden tunnel and a cave, exceptional vegetation, and a walking trail that provided land access. You can visit two more fortresses: the fortress Barone and the fortress of saint John (Ivan) that was used for filming an episode of the Game of Thrones.</p>\r\n\r\n<p>The second UNESCO-protected monument is a great cathedral of saint Jakov that is placed in the center of the old town. It was built for more than a hundred years, entirely made of stone, with amazing 72 stone portraits of human heads. It was also a set for Game of Thrones- the famous city of Braavos.</p>\r\n\r\n<p>Just a couple of kilometers from &Scaron;ibenik (Dubrava) there is a famous Eagle center where you are given an opportunity to see those magnificant birds flying hight in the trees and always coming to the call of their owners. In the pleasant shade of the trees and the silence of the nature, organizers will introduce you to the birds and even demonstrate some tricks. If you are not affraid of the eagles, you can also participate in the demonstration.</p>\r\n\r\n<p>Two national parks &ndash; Krka and Kornati make the natural beauty of &Scaron;ibenik. You will be fascinated by the amazing Krka waterfalls, sound of crystal water running down, smell of numerous plants and the variaty of little animals. Beautiful meadows, swimmnig under the waterfalls, lunch at the restaurant, souvenir shop, old customs demonstrations&hellip; so many things to see and do in the park. National park Kornati, with a collection of almost 90 islands, is a mixture of grey rocky cliffs and the clear blue Adriatic sea. During the heavy weather, sailors find a shelter there.</p>\r\n\r\n<p>You seek for activities and adrenaline?&nbsp; You can go bungee jumping from the &Scaron;ibenik&#39;s bridge, try paintball, go horse riding, mountain climbing, try zipline, windsurfing, swimming, diving, yoga or tennis.</p>\r\n\r\n<p>For a complete relaxation and fun you can go to &Scaron;ibenik&#39;s resorts Solaris and Obonjan. They are providing so many contents for children and adults and its aquapark will surely remain unforgettable.</p>\r\n\r\n<p>There are some of the souvenirs from &Scaron;ibenik you can not go home without. Famous traditional hat, bottun, old money/coins (bagatin), the red coral or maybe a bottle of top noch vine from the area of &Scaron;ibenik. These are just couple of so many memories you can collect and bring home.</p>\r\n\r\n<p>If you were not sure to book a villa near Sibenik, we hope that this text will encourage you to book your villa in this beautiful city today.</p>\r\n\r\n<p>&nbsp;</p>', '2002', 'publish', 9, '1643976306', 'post'),
